import React, { Component } from 'react';
import images from "./images.json";
import './App.css';
import Jumbotron from './components/jumbotron/index'
let score = 0;

class App extends Component {

  state = {
    images: images,
    score: score
  };



  render() {
    return (
      <Jumbotron />
    )
  }
}

export default App;
